static Comparator<ShardDoc> comparatorScore() {
  return new Comparator<ShardDoc>() {
    @Override
    public final int compare(final ShardDoc o1, final ShardDoc o2) {
      final float f1 = o1.score;
      final float f2 = o2.score;
      if (f1 < f2)
        return -1;
      if (f1 > f2)
        return 1;
      return 0;
    }
  };
}

